import css from './footer-style-sheet.css';

const Footer = () => (
    <div>
        <div className={css.footer}>
            <p className="text-center" className={css.fooeter_text}>
                Copyright@ 2020
                    <span style={{ fontSize: 'smaller',color: 'red' }}> Muhalik </span>
                - Online Shopping Website
            </p>
        </div>
    </div>
)

export default Footer;
